import Movie from '../Movie'


export default function ListOfMovies({ films}) {
  

  /*
    useEffect(() => {
        getFilms({ keyword , page })
            .then(films =>{
              setFilms(films)
            }) 
    }, [keyword, page]) 

  */
  return films.map(({Title, imdbID, Poster}) => 
      <Movie
        key = {imdbID}
        title = {Title}
        image = {Poster}
      /> 
  )
}
